import React from 'react';
import './Color.css';

const Color = ({color1,color2})=>{

  return(
    <div className="each-color-composition">

      <div className="left-compose" style={{backgroundColor:color1}}>
      </div>
      <div className="right-compose" style={{backgroundColor:color2}}>
      </div>

    </div>
  )
}

export default Color;
